import React, { useState, useEffect } from "react";
import axios from "axios";
import { Link, useNavigate } from "react-router-dom";
import Layout from "../components/Layout/Layout";
import '../styles/Login.css';
import Cookies from 'js-cookie'

function Booking() {
    const [CustomerID, setCustomerID] = useState();
    const Email = Cookies.get('Email');
    useEffect(() => {
        axios.post('https://localhost:7092/api/Customer_Details/FindEmail', {
            customer_Email: Email
        })
            .then(res => {
                console.log("fetch",res.data.customer_Id);
                setCustomerID(res.data.customer_Id);
            })

            .catch(err => console.log(err));
    }, [])
    values.
    const [values, setValues] = useState({
        customer_Id: CustomerID,
        date: '',
        time: '',
        restaurant_Id: '',
        noOfTables: ''
    });
    console.log("values", values)
    const [errors, setErrors] = useState({});
    const navigate = useNavigate();

    const handleChange = (e) => {
        setValues({ ...values, [e.target.name]: e.target.value });
    };

    const validateForm = () => {
        let formErrors = {};
        let isValid = true;

        // Validation logic here

        if (!values.date) {
            formErrors.date = "Date is required";
            isValid = false;
        }
        if (!values.time) {
            formErrors.time = "Time is required";
            isValid = false;
        }
        if (!values.numberOfTables) {
            formErrors.numberOfTables = "Number of tables is required";
            isValid = false;
        }

        setErrors(formErrors);
        return isValid;
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        if (validateForm()) {
            try {
                const response = await axios.post('https://localhost:7092/api/Reservation', values);
                console.log(response.data);
                window.alert('Table is Booked Successfully');
                navigate('/home');
            } catch (error) {
                setErrors({ message: error.response.data.message });
            }
        }
    };

    return (
        <Layout>
            <div className="d-flex w-100 vh-100 justify-content-center backgroundcolorset">
                <div className="w-50 border border-black shadow px-5 pt-3 pb-5 rounded border-set">
                    <h3 className="head">Make a Reservation</h3><br />
                    <form onSubmit={handleSubmit}>
                        {/* <div className="mb-2">
                            <label htmlFor="name"> Name:</label>
                            <input
                                type="text"
                                name="name"
                                className="form-control"
                                placeholder="Enter Customer Name"
                                value={values.name}
                                onChange={handleChange}
                                required
                            />
                            {errors.name && <div className="text-danger">{errors.name}</div>} */}
                        {/* </div><br/> */}
                        <div className="mb-2">
                            <label className="book-color" htmlFor="date">Date:</label>
                            <input
                                type="date"
                                name="date"
                                className="form-control"
                                placeholder="Enter Date"
                                value={values.date}
                                onChange={handleChange}
                                required
                            />
                            {errors.date && <span className="text-danger">{errors.date}</span>}
                        </div><br />
                        <div className="mb-2">
                            <label className="book-color" htmlFor="time">Time:</label>
                            <input
                                type="text"
                                name="time"
                                className="form-control"
                                placeholder="Enter Time"
                                value={values.time}
                                onChange={handleChange}
                                required
                            />
                            {errors.time && <span className="text-danger">{errors.time}</span>}
                        </div><br />
                        <div className="mb-2">
                            <label className="book-color" htmlFor="numberOfTables">Number of Tables:</label>
                            <input
                                type="number"
                                name="numberOfTables"
                                className="form-control"
                                placeholder="Enter Number of Tables"
                                value={values.numberOfTables}
                                onChange={handleChange}
                                required
                            />
                            {errors.numberOfTables && <span className="text-danger">{errors.numberOfTables}</span>}
                        </div><br />
                        <button className="btn btn-success m-1" type="submit">Save</button>
                        <Link to="/" className="btn btn-primary m-1">Back</Link>
                    </form>
                    {errors.message && <div className="alert alert-danger" role="alert">{errors.message}</div>}
                </div>
            </div>
        </Layout>
    );
}

export default Booking;
